import { World } from "lively.morphic";
import { arr } from "lively.lang/index.js";

export default class EmptyWorld extends World {

  onLoad() {
    this.relayout();
  }

  relayout() {
    let bounds = this.windowBounds();
    if (!this.extent.equals(bounds.extent()))
      this.extent = bounds.extent();
    this.relayoutLogo();
  }

  relayoutLogo() {
    let l = this.get("background-logo");
    if (!l) return
    l.reactsToPointer = false;
    let bounds = this.windowBounds();
    let {width, height} = l;
    l.scale = 1
    let imageWidth = 2/3*bounds.width, imageHeight = 2/3*bounds.height;
    l.scale = Math.min(imageWidth / width, imageHeight / height)
    l.center = bounds.center();
  }

  onWindowResize(evt) {
    super.onWindowResize(evt);
    this.relayout();
  }

}

